import './App.css';
import Button from './Button/Button.js'
import Item from './Item/Item.js'

function App() {
  return (
    <div className="App">
      <h1>test</h1>
      <Button text="Back" />
      <Button text="Share" />
      <Button text="Reser" />
      <Button text="Lock" />

<br></br>
      <Item name="Whip" type="WeaponsBase" />
      <Item name="Axe" type="WeaponsBase" />
      <Item name="VentoSacro" type="WeaponsBase" />
      <Item name="SongOfMana" type="WeaponsBase" />

    </div>
  );
}


export default App;
